package org.rangiffler.service;

import java.util.ArrayList;
import java.util.List;
import java.util.UUID;
import java.util.stream.Collectors;
import org.rangiffler.model.FriendStatus;
import org.rangiffler.model.UserJson;
import org.springframework.stereotype.Service;

@Service
public class UserService {

  private final UserJson currentUser = UserJson.builder()
      .id(UUID.randomUUID())
      .username("Current username")
      .firstName("Current firstName")
      .lastLame("Current lastName")
      .avatar(
          "data:image/jpeg;base64,\n")
      .build();

  private final List<UserJson> allUsers = new ArrayList<>(List.of(UserJson.builder()
          .id(UUID.randomUUID())
          .username("Pizzly")
          .firstName("Pizzly")
          .lastLame("Awesome")
          .avatar(
              "data:image/jpeg;base64,\n")
          .friendStatus(FriendStatus.FRIEND)
          .build(),
      UserJson.builder()
          .id(UUID.randomUUID())
          .username("Niffler")
          .firstName("Niffler")
          .lastLame("Great")
          .friendStatus(FriendStatus.NOT_FRIEND)
          .avatar(
              "data:image/jpeg;base64,\n")
          .build(),
      UserJson.builder()
          .id(UUID.randomUUID())
          .username("Rangiffler")
          .firstName("Rangiffler")
          .lastLame("Junior")
          .friendStatus(FriendStatus.INVITATION_SENT)
          .avatar(
              "data:image/jpeg;base64,\n")
          .build(),
      UserJson.builder()
          .id(UUID.randomUUID())
          .username("Brusnika")
          .firstName("Jagoda")
          .lastLame("Kislaya")
          .friendStatus(FriendStatus.INVITATION_RECEIVED)
          .avatar(
              "data:image/jpeg;base64,\n")
          .build()
  ));

  public List<UserJson> getAllUsers() {
    return allUsers;
  }

  public UserJson getCurrentUser() {
    return currentUser;
  }

  public List<UserJson> getFriends() {
    return allUsers.stream().filter(user -> user.getFriendStatus().equals(FriendStatus.FRIEND))
        .collect(Collectors.toList());
  }

  public UserJson sendInvitation(UserJson user) {
    UserJson userJson = allUsers.stream().filter(u -> u.getId().equals(user.getId())).findFirst()
        .orElseThrow();
    userJson.setFriendStatus(FriendStatus.INVITATION_SENT);
    return userJson;
  }

  public UserJson acceptInvitation(UserJson friend) {
    UserJson userJson = allUsers.stream().filter(u -> u.getId().equals(friend.getId())).findFirst()
        .orElseThrow();
    userJson.setFriendStatus(FriendStatus.FRIEND);
    return userJson;
  }

  public UserJson declineInvitation(UserJson friend) {
    UserJson userJson = allUsers.stream().filter(u -> u.getId().equals(friend.getId())).findFirst()
        .orElseThrow();
    userJson.setFriendStatus(FriendStatus.NOT_FRIEND);
    return userJson;
  }


  public UserJson removeUserFromFriends(UserJson friend) {
    UserJson userJson = allUsers.stream().filter(u -> u.getId().equals(friend.getId())).findFirst()
        .orElseThrow();
    userJson.setFriendStatus(FriendStatus.NOT_FRIEND);
    return userJson;
  }

  public UserJson updateCurrentUser(UserJson user) {
    currentUser.setAvatar(user.getAvatar());
    currentUser.setUsername(user.getUsername());
    currentUser.setFirstName(user.getFirstName());
    currentUser.setLastLame(user.getLastLame());
    return currentUser;
  }

  public List<UserJson> getInvitations() {
    return allUsers.stream()
        .filter(user -> user.getFriendStatus().equals(FriendStatus.INVITATION_RECEIVED))
        .collect(Collectors.toList());
  }
}
